import { Component, OnInit} from '@angular/core';
import { ItemService } from './services/restapi.service';
import { Notify } from 'notiflix';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent implements OnInit {

  items2: any[];

  constructor(private itemService: ItemService) {

  }

  getData(): void {
    try
    {
      //if (id != null)
      //{
        this.itemService.getItems().subscribe(items => {this.items2 = items} );
        Notify.success('Accion realizada correctamente.');
      //}
      //else
      {
        Notify.warning('Existen campos vacios.');
      }

    }
    catch (exception)
    {
      Notify.failure('Error en obtener informacion del servidor. Codigo: ' + exception);
    }
  }

  ngOnInit() {

  }

  title = 'Express Server Test Frontend';
}
<input #intp type="number" class="form-control" id="inputPassword2" placeholder="ID">
<button class="btn btn-primary mb-2" (click)="getData()">Solicitar</button>

